class Stack{
   
    constructor(){
        this.arraylist = [];
    }
    push(value){
        const minsofar = this.arraylist.length ===0 ?value : Math.min(value,this.minvalue());
        this.arraylist.push({value,minsofar});
    }
    minvalue(){
        if(this.arraylist.length === 0) return null;
        return this.arraylist[this.arraylist.length-1].minsofar;
    }
    print(){
        console.log(this.arraylist);
        }
    pop(){
        if(this.arraylist.length ===0) return null;
        return this.arraylist.pop();
    }
}
const stack = new Stack();
stack.push(10);
stack.push(20);
stack.push(30);
stack.push(10);
stack.push(5);
console.log(stack.minvalue());
stack.print();